import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import Experiences from "./Experiences";
import Achievements from "./Achievements";
// import Icons from "./Icons";

const useStyles = makeStyles((theme) => ({
  container: {
    height: 350,
    paddingTop: theme.spacing(20),
    paddingBottom: theme.spacing(500),
    zIndex: 1,
    //     display: "flex",
    //     justifyContent: "center",
    //     alignItems: "center",
    [theme.breakpoints.down("sm")]: {
      height: 750,
    },
  },

  titleHolder: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
  },

  infoHolder: {
    paddingTop: theme.spacing(10),
  },

  expHolder: {
    width: "50%",
    float: "left",
    height: "100%",

    [theme.breakpoints.down("sm")]: {
      paddingTop: theme.spacing(5),
      width: "100%",
      height: "50%",
    },
  },

  expTitle: {
    marginLeft: theme.spacing(17),
    [theme.breakpoints.down("sm")]: {
      marginLeft: theme.spacing(0),

      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    },
  },

  achievementHolder: {
    width: "50%",
    float: "right",
    height: "100%",

    [theme.breakpoints.down("sm")]: {
      paddingTop: theme.spacing(5),
      width: "100%",
      height: "50%",
    },
  },

  achievementTitle: {
    marginLeft: theme.spacing(17),
    [theme.breakpoints.down("sm")]: {
      marginLeft: theme.spacing(0),

      display: "flex",
      alignItems: "center",
      justifyContent: "center",
    },
  },
}));

export default function Portfolio() {
  const classes = useStyles();

  return (
    <div className={classes.container} id="Portfolio">
      <Box className={classes.titleHolder}>
        <Typography variant="h3">My Portfolio</Typography>
      </Box>
      <Box className={classes.infoHolder}>
        <Box className={classes.expHolder}>
          <div className={classes.expTitle}>
            <Typography variant="h4">Work Experiences</Typography>
          </div>
          <Experiences />
        </Box>
        <Box className={classes.achievementHolder}>
          <div className={classes.achievementTitle}>
            <Typography variant="h4">Achievements</Typography>
          </div>
          <Achievements />
        </Box>
      </Box>
    </div>
  );
}

/*
    Experiences can be featured in a table,

    Achievements can be featured in a table,

    Projects can be features in a form of card medias
*/
